import React from 'react';
import styled from 'styled-components';
import './SecondPanel.css';
import Illustration from './Illustration';

const TallContainer = styled.div`
  height: 90vh;
`;

const AboutPanelVerticalSeparator = styled.div`
  padding: 150px 0px;
`;

const AboutPanelContainer = styled.div`
  display: flex;
  flex-wrap: wrap;
  -webkit-box-pack: justify;
  justify-content: space-between;
  -webkit-box-align: center;
`;

const AboutPanelTitle = styled.p`
  margin-top: 16px;
  flex: 1;
`;

export default function SecondPanel() {
  return (
    <TallContainer>
      <AboutPanelVerticalSeparator />
      <AboutPanelContainer>
        <div className='SecondPanel-text-container'>
          <AboutPanelText>Better than Charles Babbage</AboutPanelText>
          <p className='SecondPanel-secondary-text'>
            Hello! Im Noah, a computer science student based in Gainesville, FL
            who loves building things that live on the internet. I develop
            exceptional websites and web apps that provide intuitive,
            pixel-perfect user interfaces with efficient and modern backends.
          </p>
        </div>
        <Illustration />
      </AboutPanelContainer>
      <div className='SecondPanel-center'>
        <p className='SecondPanel-center-primary'>Thats not all</p>
        <p className='SecondPanel-secondary-text'>
          I also made a meme once and it got like 100 views. kinda crazy
        </p>
      </div>
    </TallContainer>
  );
}
